\"replied_to\",\"id\":\"1403099315040624643\"}],\"conversation_id\":\"1403040872145489922\",\"possibly_sensitive\":false,\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"in_reply_to_user_id\":\"970421608362934272\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":6,\"quote_count\":0},\"created_at\":\"2021-06-11T09:17:41.000Z\",\"author_id\":\"122146038\"},{\"source\":\"Twitter for Android\",\"lang\":\"de\",\"id\":\"1403276336337195011\",\"text\":\"@pia_lamberty Alle wollen Beamte werden.\\n\\nUnd jammern herum, dass das nicht funktioniert.\\n\\nAuch #IchbinHanna.\",\"entities\":{\"mentions\":[{\"start\":0,\"end\":13,\"username\":\"pia_lamberty\",\"id\":\"2316172198\"}],\"hashtags\":[{\"start\":96,\"end\":108,\"tag\":\"IchbinHanna\"}]},\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403081714520428546\"}],\"conversation_id\":\"1403081714520428546\",\"possibly_sensitive\":false,\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"in_reply_to_user_id\":\"2316172198\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":2,\"quote_count\":0},\"created_at\":\"2021-06-11T09:02:04.000Z\",\"author_id\":\"1238776140094996481\"},{\"source\":\"Twitter for iPhone\",\"lang\":\"de\",\"id\":\"1403253091995197442\",\"text\":\"Wissenschaftler &amp; Studierende sagen zunehmend ES REICHT! Weil es eben nicht reicht, was die Politik hier veranstaltet. Bei der anstehenden Wahl müssen Parteien daran gemessen werden, was sie konkret für einen Systemwandel tun werden! #IchbinHanna #95vsWissZeitVG #Prekariat\",\"conversation_id\":\"1403253091995197442\",\"entities\":{\"hashtags\":[{\"start\":238,\"end\":250,\"tag\":\"IchbinHanna\"},{\"start\":251,\"end\":266,\"tag\":\"95vsWissZeitVG\"},{\"start\":267,\"end\":277,\"tag\":\"Prekariat\"}]},\"possibly_sensitive\":false,\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":2,\"quote_count\":0},\"created_at\":\"2021-06-11T07:29:42.000Z\",\"author_id\":\"725034352732704768\"},{\"source\":\"Twitter for iPhone\",\"lang\":\"de\",\"id\":\"1403123695208501255\",\"text\":\"Anna, Dr. Phil.; engagierte Lehrer:innenbildnerin und Schulforscherin; nach langer Zuständigkeit für universitäre Daueraufgaben ohne langfristige Perspektive nun außerhalb des Wissenschaftssystems wirksam. Hallo Brain-Drain, #IchbinHanna. #DauerstellenfürDaueraufgaben\",\"conversation_id\":\"1403123695208501255\",\"entities\":{\"hashtags\":[{\"start\":225,\"end\":237,\"tag\":\"IchbinHanna\"},{\"start\":239,\"end\":268,\"tag\":\"DauerstellenfürDaueraufgaben\"}]},\"possibly_sensitive\":false,\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":1,\"quote_count\":0},\"created_at\":\"2021-06-10T22:55:32.000Z\",\"author_id\":\"3689647995\"},{\"source\":\"Twitter for Android\",\"lang\":\"de\",\"id\":\"1403085083419021312\",\"text\":\"Wir diskutierenn ein neues Hochschulgesetz in Berlin. Zentral ist für mich die Schaffung einer unbefristeten wissenschaftlichen Personalkategorie im angestellten Mittelbau - einsetzend nach der Promotion. Wie die heißt, ist egal: Lecturer, Dozent, Assistent Prof. #IchbinHanna\",\"conversation_id\":\"1403085083419021312\",\"entities\":{\"hashtags\":[{\"start\":264,\"end\":276,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"public_metrics\":{\"retweet_count\":16,\"reply_count\":5,\"like_count\":93,\"quote_count\":1},\"created_at\":\"2021-06-10T20:22:06.000Z\",\"author_id\":\"47919307\"},{\"source\":\"Twitter for Android\",\"lang\":\"de\",\"id\":\"1403082158487609349\",\"text\":\"#IchbinHanna \\ndenn die Auswertung meiner Videoanalyse war aufwendig.\\nIch wurde schwanger. Wir brauchten eine Perspektive, ich ging ins Referdariat u schrieb die Diss. in der Elternzeit zuende. \\nBis heute frage ich mich, was wäre, wenn ich in der Wissenschaft hätte bleiben können.\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403079602222862336\"}],\"conversation_id\":\"1403079602222862336\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"in_reply_to_user_id\":\"771444093809467397\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":8,\"quote_count\":0},\"created_at\":\"2021-06-10T20:10:29.000Z\",\"author_id\":\"771444093809467397\"},{\"source\":\"Twitter for Android\",\"lang\":\"de\",\"id\":\"1403079602222862336\",\"text\":\"#IchbinHanna \\nHallo, ich bin Jaana und Chemielehrerin. Ich promovierte drei Jahre lang mit einem \\\"Stipendium\\\" - nach Ablauf war ich nicht mal ALG-1-berechtigt. Als das \\\"Stipendium\\\" auslief habe ich keine Weiterfinanzierung erhalten - ich brauchte allerdings noch Zeit, ... (1/2)\",\"conversation_id\":\"1403079602222862336\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":7,\"quote_count\":0},\"created_at\":\"2021-06-10T20:00:19.000Z\",\"author_id\":\"771444093809467397\"},{\"source\":\"Twitter for iPhone\",\"lang\":\"de\",\"id\":\"1403054114259484675\",\"text\":\"Ich bin Stefan. Psychologe &amp; Neurowissenschaftler, 36 und befristet beschäftigt. Damals naiv nach \\uD83C\\uDDE9\\uD83C\\uDDEA um evtl. längerfristig zu forschen, aber ein paar Jahre nach dem Dr. ist hier meist Schluss (währenddessen baut man im Heimatland am selben System). #IchbinHanna #95vsWissZeitVG\",\"conversation_id\":\"1403054114259484675\",\"entities\":{\"hashtags\":[{\"start\":254,\"end\":266,\"tag\":\"IchbinHanna\"},{\"start\":267,\"end\":282,\"tag\":\"95vsWissZeitVG\"}]},\"possibly_sensitive\":false,\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"public_metrics\":{\"retweet_count\":2,\"reply_count\":0,\"like_count\":45,\"quote_count\":0},\"created_at\":\"2021-06-10T18:19:02.000Z\",\"author_id\":\"725034352732704768\"},{\"source\":\"Twitter for iPhone\",\"lang\":\"de\",\"id\":\"1403027654626906119\",\"text\":\"auch #IchbinHanna\",\"conversation_id\":\"1403027654626906119\",\"entities\":{\"hashtags\":[{\"start\":5,\"end\":17,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":14,\"quote_count\":0},\"created_at\":\"2021-06-10T16:33:54.000Z\",\"author_id\":\"846099575043735552\"},{\"source\":\"Twitter for Android\",\"lang\":\"de\",\"id\":\"1403003491031740419\",\"text\":\"Nicht #IchbinHanna. Ich habe nach 10 Jahren an der Universität erkannt, dass ich Geld und Sicherheit im Leben brauche und deswegen rechtzeitig der Forschung den Rücken gekehrt.\",\"conversation_id\":\"1403003491031740419\",\"entities\":{\"hashtags\":[{\"start\":6,\"end\":18,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":4,\"quote_count\":0},\"created_at\":\"2021-06-10T14:57:53.000Z\",\"author_id\":\"1300137674930565127\"},{\"source\":\"Twitter for Android\",\"lang\":\"de\",\"id\":\"1402958729574862853\",\"text\":\"\\\"Er muß es mindestens eine Anzahl Jahre aushalten können, ohne irgendwie zu wissen, ob er nachher die Chancen hat, einzurücken in eine Stellung, die für den Unterhalt ausreicht.\\\" Naja, 100 Jahre später gibt's immerhin ne halbe Stelle für zwei Jahre. Max Weber 1919. #IchbinHanna\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1402958444932513794\"}],\"conversation_id\":\"1402939532849319939\",\"entities\":{\"hashtags\":[{\"start\":266,\"end\":278,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"in_reply_to_user_id\":\"47919307\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":19,\"quote_count\":0},\"created_at\":\"2021-0